column11:
@abalu_uthman Just like that, my $20 investment dropped to $11.
Bro, I entered depression. Fellow corpers didn’t need to ask, they could see it in my face. 
But that experience taught me a lesson no book could. The market sharpens you, and shapes your mindset. Now I move smarter, not faster.

